                <Link to="/details" className="btn btn-primary">View Recipes</Link>
            </div>
        </section>

        <Header />

		<Routes>

			<Route path='/' element={<Home />} />
			<Route path='/catalog' element={<Catalog />} />
			<Route path='/details' element={<Details />} />
			<Route path='/login' element={<Login />} />
		</Routes>
        <Footer />

     </div> 
	 ); 

}

export default App;
